import React from "react";

import "./components/Footer.css";

const Footer = () => (
  <footer className="footer-scrub">
    <p>Some footer nonsense!</p>
  </footer>
);

const App = () => (
  <div className="content">
    <h1>Hi guys!</h1>
  </div>
);



export default Footer
